css:
@-moz-document domain('marxists.org'), url-prefix('https://www.marxists.org/') {

html,body {
   background-image:none !important;
	background:#191919 !important;
	color: rgb(146, 144, 147) !important;
}
a {
	color: rgb(55, 113, 201) !important;
}
